import React, { Component } from 'react';
import { Text, View, Image, StyleSheet } from 'react-native';

export default class App extends Component {
    render() {
        return (
            <View>
                <View style={styles.fundo}>
                    <Text style={styles.titulo}>FENDER YNGWIE MALMSTEEN STRATOCASTER</Text>
                </View>
                <View>
                    <Text style={styles.subtitulo}>Guitarras - American Artist & Signatures Series</Text>
                </View>
                <View style={styles.texto}>
                <Text>
                    A FENDER® Yngwie Malmsteen Stratocaster® 
                    tem o visual e o som do guitarrista mundialmente conhecido por sua técnica e estilo único. 
                    Novas modificações, bem características do Sueco virtuoso, como: escala com escalopado 
                    mais profundo para o mínimo contato dos dedos com a madeira da escala, trastes Dunlop 6000 
                    super jumbo para facilitar os bends e a técnica de tapping, nut em bronze para um som mais
                    brilhante e maior sustain, chave de três posições e captadores Seymour Duncan® 
                    YJM single-coil, fazem dessa Stratocaster a guitarra perfeita.
                </Text>
                </View>

                <View>
                    <Image
                        source={{
                            uri:
                                'https://media.sweetwater.com/api/i/q-82__ha-31afda5f3231b660__hmac-442bd8ab3bdfaeb71d64e869628b79e0bdd574bb/images/items/750/StratYMSVW-large.jpg',
                        }}
                        style={styles.imagem}
                    />
                </View>
            </View>
        );
    }
}

const styles = StyleSheet.create({
    titulo: {
        fontSize: 18,
        fontWeight: 'bold',
        textAlign: 'center',
        margin: 5
    },
    fundo: {
        backgroundColor: '#cc0000',
        flex: 1.5
    },
    subtitulo: {
        fontSize: 11,
        fontWeight: 'bold',
        color: 'black',
        padding: 6,
    },
    texto: {
        textAlign: 'justify',
        color: 'grey',
        fontSize: 10,
        padding: 12,
        margin: 4

    },
    imagem: { width: 350, height: 310 }
});
